import React from 'react';
import {Slider} from 'react';

const MySlider = () => {
    return (
        <div className="slider">

        
        <><Slider
            aria-label="Temperature"
            defaultValue={30}
            getAriaValueText={'hello'}
            valueLabelDisplay="auto"
            step={10}
            marks
            min={10}
            max={110} /><Slider defaultValue={30} step={10} marks min={10} max={110} /></>
        </div>
    );
}
 
export default MySlider;
